import styled from 'styled-components';

const Container = styled.div`
  display:flex;
  flex-direction:column;
`;

const Header = styled.div`
  display:flex;
  flex-direction:row;
  background-color:black;
  color:white;
  padding:10px;
  font-size:25px;
  font-weight:bold;
  box-shadow:0 3px 6px 0 #555;
`;

const AppName= styled.div`
  dislay:flex;
  flex-direction:row;
  align-items:center;
`;

const MovieImage = styled.div`
  width:48px;
  height:48px;
  margin:15px;
  z-index:-1;
`

function App() {
  return (
    <div className="App">
      <Container>
        <Header>
          <AppName>
            <MovieImage src="./movie.png"></MovieImage>
            React Movie App
            </AppName>
        </Header>
        Movie App</Container>
    </div>
  );
}

export default App;
